import React, {Component} from 'react';
import axios from 'axios'
import './Chatbox.css';

class Chatbox extends Component {
    constructor(props){
        super(props)
        this.state = {
            Message: 'Hello, welcome to SymptoBot.',
            Typed: ''
        };
    }
    handleSubjectChange = (e) => {
        this.setState({Typed: e.target.value})
    }
    async componentDidMount() {
        var options = {
            url: 'https://api.infermedica.com/v2/diagnosis',
            method: 'POST',
            headers: {
                'App-Id': 'aa2fb846',
                'App-Key': '',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                sex: "male",
                age: {
                  "value": 30
                },
                evidence: [
                    {
                      "id": "s_1193",
                      "choice_id": "present",
                      "source": "initial"
                    },
                    {
                      "id": "s_488",
                      "choice_id": "present"
                    },
                    {
                      "id": "s_418",
                      "choice_id": "present"
                    }
                ]
            })
          };

          await axios.request(options).then(function (response) {
              console.log(response.data);
              console.log('hi')
          }).catch(function (error) {
              console.error(error);
          });
    }
    render() {
        return (
            <div className='Chatbox'>
                <h1 className='Chatbox-Title'>SymptoBot</h1>
                <div className='Chatbox-Content'>
                <div className='Chatbox-Message'>
                    <h1 className='Chatbox-MessageText'>{this.state.Message}</h1>
                </div>
                <form className="Contact-Form">
                    <textarea className="Chatbox-Type" value={this.state.Typed} onChange={handleChange}></textarea>
                 </form>
                </div>
            </div>
        );
    }
}

export default Chatbox;
